import { VueRouter } from "vue-router";

export const router = VueRouter.createRouter({
  history: VueRouter.createWebHashHistory(),
  routes,
});

const routes = [
  {
    path: "/",
    component: login,
  },
  { path: "/game", component: Game },
];
